import React, { App }  from 'react';
import { artworks } from "../data";

export default function Gallery() {
  return (
      <div>
        {artworks.map((artwork) => (
        <div className="project-card">
          <img className="project-image"
          alt={artwork.title}
          src={artwork.image}
          />
          <h3>
            {artwork.title}
          </h3>
          <h4>
            <em>{artwork.artist}</em> ({artwork.year})
            <br />
            {artwork.media[0]}
          </h4>


          <p>
            {artwork.description}
          </p>

        </div>
        ))}
      </div>

  );
}
